import useLocale from '../../../.dumi/hooks/useLocale';
const locales = {
  cn: {
    input: '\u8F93\u5165\u6846\u5143\u7D20',
    prefix: '\u524D\u7F00\u7684\u5305\u88F9\u5143\u7D20',
    suffix: '\u540E\u7F00\u7684\u5305\u88F9\u5143\u7D20',
    count: '\u6587\u5B57\u8BA1\u6570\u5143\u7D20',
  },
  en: {
    input: 'input element',
    prefix: 'prefix element',
    suffix: 'suffix element',
    count: 'count element',
  },
};
const App = () => {
  const [locale] = useLocale(locales);
  return (
    <SemanticPreview
      semantics={[
        {
          name: 'input',
          desc: locale.input,
          version: '5.4.0',
        },
        {
          name: 'prefix',
          desc: locale.prefix,
          version: '5.4.0',
        },
        {
          name: 'suffix',
          desc: locale.suffix,
          version: '5.4.0',
        },
        {
          name: 'count',
          desc: locale.count,
          version: '5.4.0',
        },
      ]}
    >
      <Input
        showCount
        prefix={<UserOutlined />}
        suffix={<EditOutlined />}
        defaultValue="Hello, Ant Design"
      />
    </SemanticPreview>
  );
};
export default App;
